import React from 'react';
import '../../App.css';
import './footer.css';

function Footer() {
  return (
    <footer id="footer">
      <div className="container">
        <div className="footer_content">
          <div className="left">
            <p>Компьютердик жана Маалыматтык Технологиялар Кафедрасы</p>
          </div>
          <div className="right">
            <div className="links">
              <a href="#">Жайгашкан жери/жумуш убактысы</a>
              <a href="#">+996556909890</a>
              <a href="#">contact@gamil.com</a>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer
